import './App.scss';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import NavBar from './0_NavBar/navbar';
import Intro from './1a_Intro/intro';
import About from './1b_About/about';
import Projects from './1c_Projects/projects';

function App() {
  return (
    <Router>
      <Switch>
        <div className="App">
          <Route exact path="/" component="{Splash}" />
          <Route component="{Default}" />
        </div>
      </Switch>
    </Router>
  );
}

const Splash = () => (
  <div>
    <Intro />
  </div>
)

const Default = () => (
  <div>
    <NavBar />
    <Route path="/About" component={About}/>
    <Route path="/Projects" component={Projects}/>
  </div>
)

export default App;
